import random
import numpy as np

# Definir las funciones para el algoritmo PSO
def RandomVelocity():
    return random.uniform(-1, 1)

def RandomPosition():
    return random.uniform(-10, 10)

def Cost(p, function):
    return function(p)

def StopCondition(iterations, max_iterations):
    return iterations >= max_iterations

def UpdateVelocity(velocity, p_best, p_position, w=0.5, c1=1, c2=1):
    r1 = random.uniform(0, 1)
    r2 = random.uniform(0, 1)
    new_velocity = w * velocity + c1 * r1 * (p_best - p_position) + c2 * r2 * (p_best - p_position)
    # Limitar la velocidad a un rango de -10 a 10
    return max(min(new_velocity, 10), -10)

def UpdatePosition(p_position, velocity):
    new_position = p_position + velocity
    # Limitar la posición a un rango de -10 a 10
    return max(min(new_position, 10), -10)


# Definir las funciones de prueba
def quadratic(x):
    return x**2

def cubic(x):
    return x**3

def sinusoidal(x):
    return np.sin(x)

# Definir las funciones de prueba en una lista
functions = [quadratic, cubic, sinusoidal]

# Definir una lista para almacenar los resultados
results = []

# Ejecutar el algoritmo PSO para cada función
for function in functions:
    minima = []
    evaluations = []
    for _ in range(10):  # Ejecutar el algoritmo 10 veces
        # Inicialización
        population = [RandomPosition() for _ in range(100)]  # Población de 100 partículas
        p_best = min(population, key=lambda p: Cost(p, function))  # Mejor posición inicial
        velocity = RandomVelocity()  # Velocidad inicial
        iterations = 0  # Contador de iteraciones

        # Iteración hasta que se cumpla la condición de parada
        while not StopCondition(iterations, 1000):  # Máximo de 1000 iteraciones
            for p in population:
                velocity = UpdateVelocity(velocity, p_best, p)
                p = UpdatePosition(p, velocity)
                if Cost(p, function) < Cost(p_best, function):
                    p_best = p
            iterations += 1

        # Almacenar el mínimo encontrado y el número de evaluaciones
        minima.append(p_best)
        evaluations.append(iterations)

    # Calcular el número de veces que se encontró el mínimo, el número promedio de evaluaciones y la desviación estándar
    num_minima = len([m for m in minima if abs(m - min(minima)) <= 1e-5])
    avg_evaluations = np.mean(evaluations)
    std_evaluations = np.std(evaluations)

    # Almacenar los resultados
    results.append([num_minima, avg_evaluations, std_evaluations])

# Imprimir los resultados en formato de tabla
print("Función\t\t# Mínimos\tEvaluaciones promedio\tDesviación estándar")
for function, result in zip(functions, results):
    print(f"{function.__name__}\t\t{result[0]}\t\t{result[1]:.2f}\t\t\t{result[2]:.2f}")

