#include <iostream>
#include <fstream>
#include <vector>
#include <chrono>
#include <algorithm>
#include <cstring>

using namespace std;
using namespace std::chrono;

void shellSort(vector<int>& array) {
    int n = array.size();
    for (int h = n / 2; h > 0; h /= 2) {
        for (int j = h; j < n; j += 1) {
            int k = array[j];
            int i;
            for (i = j - h; i >= 0 && k < array[i]; i -= h) {
                array[i + h] = array[i];
            }
            array[i + h] = k;
        }
    }
}

void printArray(const vector<int>& arr) {
    for (int num : arr) {
        cout << num << " ";
    }
    cout << endl;
}

void insertionSort(vector<int>& array) {
    int n = array.size();
    for (int i = 1; i < n; i++) {
        int key = array[i];
        int j = i - 1;

        while (j >= 0 && array[j] > key) {
            array[j + 1] = array[j];
            j = j - 1;
        }
        array[j + 1] = key;
    }
}
int main() {
    vector<int> arr;
    int el;
    ifstream input("d16.txt");

    if (input.is_open()) {
        while (input >> el) {
            arr.push_back(el);
        }
        input.close();

        cout << "Array before shell sort: \n";
        vector<int> arrCopy(arr);
        vector<int> arrQSort(arr);
        auto start = high_resolution_clock::now();
        shellSort(arr);
        auto stop = high_resolution_clock::now();
        auto duration = duration_cast<microseconds>(stop - start);
        cout << "Time taken by shell sort: " << duration.count() << " microseconds" << endl;

        start = high_resolution_clock::now();
        insertionSort(arrCopy);
        stop = high_resolution_clock::now();
        duration = duration_cast<microseconds>(stop - start);
        cout << "Time taken by insertionSort: " << duration.count() << " microseconds" << endl;
        start = high_resolution_clock::now();
        qsort(arrQSort.data(), arrQSort.size(), sizeof(int), [](const void *a, const void *b) {
            return (*(int*)a - *(int*)b);
        });
        stop = high_resolution_clock::now();
        duration = duration_cast<microseconds>(stop - start);
        cout << "Time taken by qsort: " << duration.count() << " microseconds" << endl;
        ofstream output("d16-s.txt");
        
        if (output.is_open()) {
            for (int num : arr) {
                output << num << " ";
            }
            output.close();
            cout << "Sorted array by shell sort has been written to d16-s.txt." << endl;
        } else {
            cout << "Unable to write to the file." << endl;
        }
    } else {
        cout << "Unable to open the input file." << endl;
    }

    return 0;
}

