import java.io.BufferedReader;
import java.io.File;
import java.io.FileReader;
import java.io.IOException;

public class Start {

	public static void main(String[] args) {
		String nombreArchivo = "notasPepe.txt";
		float media = 1.0f;
		File f = new File(nombreArchivo);
		FileReader fr = null;
		BufferedReader br = null;
		String linea = "";
		int contadorLineas = 0;
		String[] partes;
		float totalNotas = 0f;
		
		if (f.exists()) {
			try {
				fr = new FileReader(f);
				br = new BufferedReader(fr);
				while (linea != null) {
					linea = br.readLine();
					if (linea != null) {
						contadorLineas++;
						partes = linea.split(" ");
						totalNotas = totalNotas + Float.parseFloat(partes[1]);
					}

				}
				fr.close();
				br.close();
			} catch (IOException e) {
				System.out.println("Ha habido un error inesperado :(");
			}

		} else {
			System.out.println("El archivo no existe");
		}
		media = totalNotas / contadorLineas;
		System.out.println("La nota media del alumno es: " + media);

	}

}

#include <iostream>
#include <string>
#include <vector>
#include <sstream>
#include <algorithm>

using namespace std;

int main() {
    string str;
    getline(cin, str);

    istringstream ss(str);

    vector<string> noises;

    while (ss >> str) {
        string noise;

        for (char c : str) {
            if (!isdigit(c)) {
                noise += c;
            }
        }

        if (noises.size() > 0) {
            if (noises.front().length() > noise.length()) {
                continue;
            }
            else if (noises.front().length() < noise.length()) {
                noises = {};
            }
        }
        noises.push_back(noise);
    }

    sort(noises.begin(), noises.end());

    cout << (noises.front() != "" ? noises.front() : "no noise") << endl;

    return 0;
}

