+			if (player.isSummonAttack() && (player.getPet() != null))
+			{
+				// Siege Golem's
+				if (((player.getPet().getNpcId() >= 14702) && (player.getPet().getNpcId() <= 14798)) || ((player.getPet().getNpcId() >= 14839) && (player.getPet().getNpcId() <= 14869)))
